INSERT INTO `faq` (`faq_id`, `faq_token`, `faq_name`, `faq_desicription`, `faq_show_on_home`, `faq_status`, `position`) VALUES
(34, '8DYA8B09DW4W3CSQJKTEI3K7ZKD9X3T8RP8LT6K340M653G4AIC6820FTY332NMNWX81P7CPP7ZF53QX0MRQ2LPBAZHK3NZDEI0OLG69SDU110P5S1TV9F9ILQ20UH7K0XPTES47660ISR7YXC6U5RTZR7FKDH1WZH7M02CZSSSLL51PQPD635Y0NIUW2R27RUYAIEBS', 'અખંડ ભારત દૈનિક ન્યુઝ  નો  ધ્યેયો  શું છે ?', '<p><ul><li>સામાજિક એકરૂપતા માટે જાગૃતિ ઉભી કરવા ના પ્રયાસ કરવા</li><li>વિચારો ના વૈવિધ્યથી દેશ દાજ ઊભી કરવા કાર્ય કરવું.</li><li>એકતા અને અખંડિતતા નો સંદેશો ફેલાવવા માટે કામગીરી કરવી</li><li>સામાજિક બદિઓ થી જનમાનસ ને મુક્ત કરવા સંદેશાઓ આપવા</li><li>હકારાત્મક અભિગમ થી મુલ્યો નું સંવર્ધન કરવા પ્રયત્ન કરવો.</li><li>ભારત મારો દેશ છે અને બધા ભારતવાસી એક છીએ એ ભાવના દૃઢ કરવા સતત કાર્યશીલ રહેવું.</li><li>દેશદાઝ ઉભી કરી શકે તેવું નેતૃત્વ ઉભું કરવું</li><li>સત્યતા પ્રસ્થાપિત કરવાનો અખંડ અભિગમ રાખીને જ કામગીરી કરવી</li><li>અખંડ ભારત શબ્દ ને ચરિતાર્થ કરવા જનમાનસમાં સતત વિચારો ના બીજ રોપવા</li><li>છેલ્લા મા છેલ્લા વિસ્તાર સુધી પહોંચી ને છેવાડાના લોકોને પણ આ સમાચાર પત્ર સાથે જોડાવા ના પ્રયાસ કરવા</li></ul><br></p>', NULL, 'yes', NULL),
(35, '0UJCLULGVIUZLJM1Z6VM9NVPK07HDW6O70VS6HFTXLGV058SOS07SFSPD0URYM8HN5C3SV9Q18QMT8ZHLMN2VQB426UDW5KTC8XBRXV6WE0OHOT0KOHGXTYRXYSFR3GHLSI85UVKBSFDJ9QYID4WSD69EENDHVUQY68HZK44KQANPX25RZ3W8VI5OQNWL3LET0C8SHSO', 'અખંડ ભારત દૈનિક ન્યુઝ ક્યાંથી પ્રસિદ્ધ થાય છે?', '<p>અખંડ ભારત દૈનિક ન્યુઝ એ ગાંધીનગરથી પ્રસિધ્ધ થતુ નિડર અને ધ્યેયલક્ષી દૈનિક છે.<br></p>', NULL, 'yes', NULL),
(36, 'TL1HRF9ZXWTXFMZL7K2O2KDWTPPCA1HQGKHZ4SX93FG4DTEP3876D8MFUCYBWTJDJCK7JDF8A81OX5L47VZOF6SGFFI4ID0JZXE01U4TLAI4UU4V32FZC20N2GBRZ5ORRR84EOY60FZS4V5WEKEBJVDJEDQKD6ESSCTQ17KY0LLUYQXBZDDKY4G8CE1P4CXST4R75GDX', 'અખંડ ભારત દૈનિક ન્યુઝ કેટલો એરિયા કવર કરે છે?', '<p>\r\n\r\nઅખંડ ભારત દૈનિક ન્યુઝ એ ગુજરાત નો સમગ્ર એરિયા કવર કરે છે.\r\n\r\n<br></p>', NULL, 'yes', NULL),
(37, 'AOCGY03A1W5870LBAWM6QVIHUXTRSAE86035QJD50FBM723JZTL0PETDZL6L3NXOGI9RMPPT7EB2T01ADYE5XD2KIOZX2XWD6UGJB02PDEXAJ6Y7KIGSYVL9FUKY93H2EZJWDVD7GAGLXT8IQM1BF2B0P2XO4IFZ0F9CLATZWL5SLI059GL5ZI9GJEKAEGQJ57ARZMEB', 'પત્રકાર બનવા થી શુ લાભ થાય છે?', '<p>\r\n\r\nઆમ તો પત્રકારિત્વ શબ્દમાં જ તેના લાભા લાભ ની વ્યાખ્યા આવી જાય છે માનવતા તરફનું એક પગલું એટલે શ્રેષ્ઠ પત્રકારત્વ. તેમ છતાં જોઈ એ તેના થી થતા લાભો.</p><p></p><p></p><ul><li>નિડરતા વધે છે અને નેતૃત્વ ઉભું કરી શકાય છે.</li><li>નવા -જુની જાણવા અને વ્યક્ત કરવાની ભાવના જાગે છે.</li><li>પત્રકાર એક આગવી ઓળખ ધરાવતું વ્યક્તિ બની શકે છે.</li><li>માન મર્યાદા અને મોભો ઉભો કરી શકાય છે.</li><li>વિચારોને વ્યક્ત કરતી જાહેર જીવનની વ્યક્તિ એટલે પત્રકાર પ્રાપ્ત કરી શકે એના કરતા કલમના જોરથી બીજાને પ્રાપ્ત કરાવી શકે, લાભ અપાવી શકે ,ન્યાય અપાવી શકે એનું નામ પત્રકારત્વ</li><li>સતત વિચારશીલ વ્યક્તિત્વ નું ઘડતર થઈ શકે છે.</li><li>અસંખ્ય લોકો સાથે જોડાણ કરી શકે,વિચારો વ્યક્ત કરી શકે, જાગૃતિ લાવી શકે એનું નામ પત્રકારત્વ.</li><li>કોઈના દુઃખનો સહારો બની શકવાનો સૌથી મોટો લાભ આ ક્ષેત્રમાં મળે છે.</li><li> જાગૃતિ લાવવા માટેના બધા જ માધ્યમોનો ઉપયોગ પત્રકાર કરી શકે છે.</li><li>સારા પત્રકાર બનવા માટે માહિતીસભર રહેવું પડે વિચાર વાંચન નિરીક્ષણ અવલોકન કરવાથી વ્યક્તિગત વિકાસ કરવાનો લાભ થાય છે.</li></ul><p></p><p></p>', NULL, 'yes', NULL),
(38, 'NCRZET6CY98GK269X4BEJILMW2EDVX0B2O6CK8R02VK6QLXIH1MAMV0JPMO3VZMNATCH0DJ5AEXMTJ4GL90HKJXLPUR1SU09GXDONYRRQ6DL4OGFBPHI1PZTHSWW145UMYG8PJOYPGJSLOUVA2ZPCOV3P05IRSPM67B3RSKTG5ZU21T8QV70LQORE5RRB799EILT7KGJ', 'અખંડ ભારતના રિપોર્ટરની કીટ માં શું શું આપવામાં આવશે ?', '<p></p><div><div><ul><li>આઈડી કાર્ડ</li><li>નિમણૂક પત્ર </li><li>વેબસાઇટ પર પ્રોફાઇલ</li><li>સ્ટીકર (2Pac)</li><li>ન્યૂઝ પેપરમાં રિપોર્ટરનું સ્વાગત/અભિનંદન ફોટો સાથે કરવામાં આવશે</li></ul></div></div><p></p>', NULL, 'yes', NULL),
(39, 'CD8Z1YWW5S6PMEN1KYAP36F5UMLLQNA7FPTLHBZ6K09OND71KLMHL2EGTTGOQSRRO9QMSVX28PO8LE6QLWZU5F1PLKNM8JG74PIKA0FI47J0U4DT0Y8X7GUUNFIHM4VXUJJRAVBIZK0KVO1SOTL6QCBZ51M5VO12U0XFWYPKCMWTB27YK5K315FHL6CXLF6YXOQVV39C', 'અખંડ ભારત દૈનિક ન્યુઝ કેટલા વર્ષોથી પ્રસિદ્ધ થાય છે ?', '<p>અખંડ ભારત દૈનિક ન્યુઝ છેલ્લા 13 વર્ષથી પ્રસિદ્ધ થાય છે.\r\n\r\n<br></p>', NULL, 'yes', NULL),
(40, 'T0O4QTF0I7HKWFFUTRITJP1MB05XIA9UNBQ1PHBLBP057XA3K4OACG4ZV6Z8IF8DLSBUQW33LX46VH3MR3HCFF5GTP4V0YRIM5ZGWGWCK9NGGT03GWG5EEGNHS25W3P4QSO4U8O2WTPDGDH5XWISLMO97CGP83J25865MDOBNUOH4CR2SJUXCBP7PNU3MXIWI57XF4N4', 'માનદ પત્રકાર નિમણૂંક કઈ કઈ જગ્યાએ થઇ રહ્યા છે ?', '<p></p><div><div><ul><li>જિલ્લા વાઈઝ - એક ભાઈ અને એક બેન</li><li>તાલુકા વાઈઝ - એક ભાઈ અને એક બેન</li><li>ગ્રામ પંચાયત વાઈઝ - એક ભાઈ અને એક બેન</li></ul></div></div>\r\n\r\n<br><p></p>', NULL, 'yes', NULL),
(41, '1ZN7DQ65ASRKBSYVOUY4P1B39PC1T4RAWWYW5EEA1SIRZ3F0YSJUZJ7HY50SK7Y3HEHV6WWZ1JH2FYC0H7WM0PXLVDYQHBM17P9N3YELMWR7DPOBVKY6PV6FQ227E8R2D4P2JTU8EWBGZSBZRAOLE6CLZYXSDHNSGT4DB62ZIH7F0NVTHI6FC393N0CHSPN8YKCKAAQ2', 'માનદ પત્રકાર નિમણૂંક થવા સંપર્ક કોનો કરવો ?', '<p>\r\n\r\n</p><blockquote>પત્રકાર માનદ નિમણૂક માટે અમારો સંપર્ક નંબર : 91062 82092<br></blockquote>\r\n\r\n<p></p>', NULL, 'yes', NULL);
