(1, 'QA04XNK0IWE4KNCOMVPQOFYKBH7Y19PA0WDTNPZ68ZH18M2YUTP33MUUQCGB6WHVYGAOXECWFJWP7PGIEM8IY4AXLWBMXSM98NQZ4ID16JFEKQZZBN2X547J24UHMYUY6EYKY5MUZEJ82NY02QIOPMWAULUQCYULJ3USDT7COUA5EKDNDMJKIPR21VYATTYSW02T8WAF', 'સંતશ્રી લાલજી મહારાજ.', '811592_testimonials.jpg', '1725972009', '<p>\r\nઅખંડ ભારત દૈનિક ન્યુઝ ગાંધીનગર ને મારા ભગવાન શામળિયા ના આશીર્વાદ. અખંડ ભારત શબ્દમાં જ પવિત્ર કાર્ય ની ભાવના વર્તાય છે. ખૂબ પ્રગતિ કરો.....\r\n\r\n<br></p>', '5', 'Active', 'ઉત્તર ગુજરાત, શામળાજી. શ્રી શામળિયા સાધના આશ્રમ वङतापुर.....', 0),
(3, 'GFT4RQUYF38X1VP9RQDME8HLEXS8RUQS33MCB4MD5T9HH3OU5HGEVW17VKS6P65P66N07Y48L15FY3KO9UNX32SBRPP3WJEDYX24FZWW9WLL0H7YHZ0ZVF6QGSFTELOMG8P9YWPIA38JTZB3R1PW9M45HUKACJ5UYPOQV6NA6KR5Y0D1TY05N04FQB5I85RUCWP96LO0', 'વિશાલકુમાર ભરતભાઇ શાહ', '281093_testimonials.jpg', '1725972074', '<p>અખંડ ભારત દૈનિક ન્યુઝ એ વિચાર મંચ સાથે પ્રેરક વિચારોનું એક્સેલન્ટ કામ કરી રહ્યું છે. ધન્યવાદ<br></p>', '5', 'Active', 'સાયબર અવેરનેશ પ્રમોટર ગુજરાત રાજ્ય અને ડાયરેક્ટર (તાલીમ) સાયબર સિક્યુરીટી ફોર્સ (વર્લ્ડ રેકર્ડ હોલ્ડર)', 0),
(2, 'JUV9YZPI0O9Y5YLK8BQTPQJQVZJ5VUW3M18BD3IAPM83ZHKZPIOPZAICUSNT51A1E037R7VF57XQZT8X8H0I91OHFP9R0KI57JWFNC0AMYTVGJ4ZTX8RJHLQYCWLPXX1WNGS61SPDXBZHKO18N4TQLRMTJ4NZUICL91338RZQ0VGMDI41QRSZBU7FFLR1AVAB0RBF6DB', 'એન ડી પટેલ', '206030_testimonials.jpg', '1725971664', '<p>\r\n\r\nખૂબ જ સરસ કામગીરી શાબાશ,ડર્યા વગર કોલમ લખવી એ કાર્ય કુશળતા પત્રકારત્વની સાચી નિશાની છે.\r\n\r\n<br></p>', '5', 'Active', 'ગુજરાત રાજ્ય આચાર્ય સંઘના ઉપપ્રમુખશ્રી, તથા પ્રમુખ શ્રી અરવલ્લી જિલ્લા આચાર્ય સંઘ શ્રી', 0),
(4, 'SXI4D9J72Z59CODEMI4IU6MTH9K3ZJSMK4V2XEBRX130V5BN5FIVF0RFC1L6MLKIPL53MLXQ3SSGWAZR2TO9PC3SEL2DF2RIJEJ8GXZ3UJF5JSYRJ9JT8GPO8A8QEQT7CEZ0LJIYKU6401KOUIRTFFCVGHPL1X7YCJVYF9NKC9O09L3FHIHUDJ1514K7N9QPTGKFLF20', 'ડોક્ટર સોનિયા જોશી', '015558_testimonials.jpg', '1725945819', '<p>\r\n\r\nઅખંડ ભારત દૈનિક ન્યુઝ ની કામગીરી ખૂબ જ સુંદર અને સરસ છે સમાચારોની વૈવિધ્યતા જોવા મળે છે.અભિનંદન\r\n\r\n<br></p>', '5', 'Active', 'શ્રી એન એસ પટેલ લો કોલેજ મોડાસા', 0);
