INSERT INTO `who_we_are` (`who_we_are_id`, `who_we_are_image`, `page_small_title`, `page_main_title`, `section_one_title`, `section_one_content`, `section_two_title`, `section_two_content`, `our_technolgy_item_show`, `section_three_image`, `section_four_image`, `section_four_content`) VALUES
(1, '589506_img1.png', 'Who we are', 'About Urban Vivah', 'who we are', '<p>\r\n</p><div>     \r\n      <div>\r\n       <p>\r\n\r\nUrban Vivah Exhibitions” is One of the India\'s Most Successful Wedding & Lifestyle Exhibition officially Awarded by Exhibition Excellence Awards - New Delhi.\r\n\r\n\"Urban Vivah Exhibitions\" has now conducted nearly 300+ Exhibitions in 35+ cities of Gujarat since 2015\r\n\r\n\r\n                            </p>\r\n          <p>Which is truly world class where all its products are \r\nmanufactured to the most stringent international standards in tune to \r\nits eco-friendly policy of green products. It also has its own R&D \r\ncenter striving for continuous upgradation of technology and principles.\r\n Its endeavor has been to bring out a combination of environment and \r\ndesign oriented operations.\r\n                            </p>\r\n       <p>The company has strong distribution network all over India. \r\nThe world renowned quality process brings a perfect fusion in the field \r\nof laminates. The company?s commitment to offer excellence in customer?s\r\n service and satisfaction remains steadfast.</p>\r\n                            <p>Strict Quality Controls, Precise \r\ninspections and Quality Raw Material help the company to Achieve uniform\r\n Quality and there by enable to meet customers wide application \r\nRequirements and hence providing them better Quality and Value For Money\r\n every time.</p>\r\n      </div>\r\n     </div>\r\n\r\n<br><p></p>', 'Why redd mica ', '<p>\r\n\r\n\r\nUrban Vivah Exhibitions” is One of the India\'s Most Successful Wedding & Lifestyle Exhibition officially Awarded by Exhibition Excellence Awards - New Delhi.\r\n\r\n\"Urban Vivah Exhibitions\" has now conducted nearly 300+ Exhibitions in 35+ cities of Gujarat since 2015\r\n\r\n\r\n\r\n<br></p>', '5', '869931_iomg2.png', '140181_img3.png', '<h4>Our <span>Vision</span> </h4>\r\n                                        <p>Redd Mica Laminates uses a unique technology in which special resins impart extra strength to its laminates.</p>\r\n                                        <h4>Our <span>Mission</span> </h4>\r\n                                        <p>By providing a wide RANGE of colors, designs & textures. Our effort is to generate amazing life galaxies with new innovative design patterns which establish new trends going hand & glove with modern contemporary interior designing. To recognize & anticipate sensitivities in trends of the periods and the movement of society.</p>\r\n                                        <h4>Strong & <span>Impecably Beautiful</span> </h4>\r\n                                        <p>Redd Mica is a flagship brand in India with verified track record of quality, toughness and consistency. With a widespread range of beautiful colors, exotic projects and exclusive performance features, you?re sure to find Redd Mica?s range of laminates fitting your surfaces with style. Superior International technology ensures them to become more everlasting among the contemporaries.</p>\r\n                                        <h4>Our <span>Motto </span></h4>\r\n                                        <p>CHALLENGE AND CREATION\r\n\r\nRedd Mica, being a part of laminate, has assumed the true INDIAN tradition of facing challenges and coming up with imaginative solutions.</p>');
